css:
.github-PrCommitView-container {
  display: flex;
  align-items: center;
  padding: 14px;
  font-size: 14px;
  border: 1px solid #1e1e1e;
  border-bottom: none;
}
.github-PrCommitView-container:first-child {
  border-top-left-radius: 2px;
  border-top-right-radius: 2px;
}
.github-PrCommitView-container:last-child {
  border-bottom: 1px solid #1e1e1e;
  border-bottom-left-radius: 2px;
  border-bottom-right-radius: 2px;
}
.github-PrCommitView-commit {
  flex: 1;
}
.github-PrCommitView-messageHeadline.is-button {
  padding: 0;
  margin-right: 9.33333333px;
  background-color: transparent;
  border: none;
  cursor: pointer;
  text-align: left;
  color: #F5F5F5;
}
.github-PrCommitView-messageHeadline.is-button:hover,
.github-PrCommitView-messageHeadline.is-button:focus {
  color: #b7b7b7;
}
.github-PrCommitView-title {
  margin: 0 0 .25em 0;
  font-size: 1.2em;
  line-height: 1.4;
}
.github-PrCommitView-avatar {
  border-radius: 2px;
  height: 16px;
  margin-right: .4em;
  width: 16px;
}
.github-PrCommitView-metaText {
  line-height: 16px;
  vertical-align: middle;
  color: #797979;
}
.github-PrCommitView-moreButton {
  margin: 0 auto 0 14px;
  padding: 0em .2em;
  color: #797979;
  font-style: italic;
  font-size: .8em;
  border: 1px solid #1e1e1e;
  border-radius: 2px;
  background-color: #404040;
}
.github-PrCommitView-moreButton:hover {
  background-color: #454545;
}
.github-PrCommitView-moreText {
  margin-top: 7px;
  padding: 0;
  font-size: inherit;
  font-family: var(--editor-font-family);
  word-wrap: initial;
  word-break: break-word;
  white-space: initial;
  background-color: transparent;
}
.github-PrCommitView-sha {
  margin-left: 14px;
  line-height: 16px;
  vertical-align: middle;
  color: #6D9CBE;
  font-family: var(--editor-font-family);
}
.github-PrCommitView-sha a {
  color: inherit;
}
